import styled from "styled-components";

const CardBlock = styled.div`
    display: flex;
    background-color: #F8F9FA;
`


const Card = () => {
    return (
        <CardBlock>
            <CardEach>
                <CardPictur></CardPictur>
                <CardText></CardText>
            </CardEach>

        </CardBlock>
    );
};

export default Card;
